# @param {Integer[]} nums
# @return {Integer[]}
def product_except_self(nums)
  # prefix_sum = {}
  # total_product = 1

  # nums.each do |num|
  #   total_product *= num
  #   prefix_sum[num] = total_product
  # end

  # prefix_sum

  product_nums = []
  cache = {}
  nums.each_with_index do |num, i|
    product = cache[num] || (nums[0...i] + nums[i+1..nums.size - 1]).reduce(1,:*)
    product_nums << product
    cache[num] = product
  end

  product_nums
end

